import React,{useEffect, useRef,useState} from "react";
import { SliderContainer,SliderItem,Image,Title,Price, RatingContainer, RatingStars,
Stars,RatingNumber,SliderItems,Arrow,StarsContainer, SliderTitle } from "../styles/SliderGalleryStyles";
import { faChevronLeft,faChevronRight,faStar } from "@fortawesome/free-solid-svg-icons";
import { removeListener } from "process";


const data = [
    {image:'data:image/jpeg;base64,',
    title:'texttttt',
    price:32444},
    {image:'data:image/jpeg;base64,',
    title:'texttttt',
    price:32444},
    {image:'data:image/jpeg;base64,',
    title:'texttttt',
    price:32444},
    {image:'data:image/jpeg;base64,',
    title:'texttttt',
    price:32444}
    ,{image:'data:image/jpeg;base64,',
    title:'texttttt',
    price:32444}
    // ,{image:'data:image/jpeg;base64,',
    // title:'texttttt',
    // price:32444}
    // ,{image:'data:image/jpeg;base64,',
    // title:'texttttt',
    // price:32444}
    // ,{image:'data:image/jpeg;base64,',
    // title:'last',
    // price:32444}
]


function SliderGallery(){
    
    const itemRef:any = useRef(null);
    const cardRef:any = useRef(null);
    const [cards,setCards] = useState(data);
    const [translate,setTranslate] = useState(1);
    const [transition,setTransition] = useState({active:true,inactive:false});
    const [width,setWidth] = useState(0);
 
  useEffect(()=>{ 
    const sliderWidth = cardRef.current.offsetWidth * cards.length;
    setWidth(-sliderWidth - 150);
  },[])
  useEffect(()=>{
    function resize(){
      const sliderWidth = cardRef.current.offsetWidth * cards.length;
      setWidth(-sliderWidth - 150);
    }
    window.addEventListener('resize',resize);
    return ()=>{
      window.removeEventListener('resize',resize);
    }
  })

    function cloneElements(){
      return React.Children.map(Array.from(Array(cards.length).keys()),function(index){
        return React.cloneElement(<SliderItem id="clone" key={index}>
          <Image src={cards[index].image}/>
          <Title>{cards[index].title}</Title>
          <Price>{cards[index].price}</Price>
          <RatingContainer>
              <RatingStars>
                  {Array.from(Array(5).keys()).map((item,index) =>{
                          return <Stars style={{color:'rgb(220,220,220)'}} key={index} icon={faStar}></Stars>
                      })}
                  <StarsContainer>
                      {Array.from(Array(5).keys()).map((item,index) =>{
                          return <Stars style={{color:'rgb(255, 191, 0)'}} key={index} icon={faStar}></Stars>
                      })}
                  </StarsContainer>
              </RatingStars>
              <RatingNumber>(2.4)</RatingNumber>
          </RatingContainer>
          </SliderItem>)})
    }
   
    

    return <SliderContainer>
                <SliderTitle>Produse</SliderTitle>
                <SliderItems className="sliderContainer" ref={itemRef} move={translate} width={width} active={transition.active} inactive={transition.inactive}>
                  {cloneElements()}
                    {cards.map((item,index) =>{
                        const {image,title,price} = item;
                            return <SliderItem ref={cardRef} key={index}>
                                    <Image src={image}/>
                                    <Title>{title}</Title>
                                    <Price>{price}</Price>
                                    <RatingContainer>
                                        <RatingStars>
                                            {Array.from(Array(5).keys()).map((item,index) =>{
                                                    return <Stars style={{color:'rgb(220,220,220)'}} key={index} icon={faStar}></Stars>
                                                })}
                                            <StarsContainer>
                                                {Array.from(Array(5).keys()).map((item,index) =>{
                                                    return <Stars style={{color:'rgb(255, 191, 0)'}} key={index} icon={faStar}></Stars>
                                                })}
                                            </StarsContainer>
                                        </RatingStars>
                                        <RatingNumber>(2.4)</RatingNumber>
                                    </RatingContainer>
                                    </SliderItem>
                        })}
                       {cloneElements()}
                </SliderItems>
                {<Arrow className="left" onClick={()=>{
                       if(translate === 1){
                        const sliderWidth = (cardRef.current.offsetWidth * cards.length);
                        setTransition((prev)=>{
                          return {...prev,inactive:true};
                        })
                        setTranslate(cards.length);
                        setWidth(-sliderWidth * 2 - 300);
                        setTimeout(()=>{
                          setTransition((prev)=>{
                            return {inactive:false,active:false};
                          })
                          setWidth((prev)=>{
                            return prev + (sliderWidth / cards.length) + 30;
                          });
                        },50)
                        
                      }else{
                        const sliderWidth = cardRef.current.offsetWidth;
                        setTranslate(translate - 1);
                        setTransition({...transition,active:true});
                        setWidth(-(Math.abs(width) - sliderWidth - 30));
                      }
                }} icon={faChevronLeft}></Arrow>}
                {<Arrow className="right" onClick={()=>{
                    if(translate === cards.length){
                      const sliderWidth = (cardRef.current.offsetWidth * cards.length);
                      setTransition((prev)=>{
                        return {...prev,inactive:true};
                      })
                      setTranslate(1);
                      setWidth(-(sliderWidth - sliderWidth / cards.length) - 120);
                     setTimeout(()=>{
                        setTransition((prev)=>{
                          return {inactive:false,active:false};
                        })
                        setWidth((prev)=>{
                          return prev - (sliderWidth / cards.length) - 30;
                        });
                      },50)
                     
                    }else{
                      const sliderWidth = cardRef.current.offsetWidth;
                      setTranslate(translate + 1);
                      setTransition({...transition,active:true});
                      setWidth(-(Math.abs(width) + sliderWidth + 30));
                    }
                }} icon={faChevronRight}></Arrow>}
    </SliderContainer>
}

export default SliderGallery;

